async function getUser(access_token) {
  const url = `https://graph.facebook.com/v3.3/me?access_token=${access_token}`;
  const result = await fetch(url);
  let jsonResult = await result.json();
  return jsonResult;
}
async function getFriendsTototal(access_token) {
  const url = `https://graph.facebook.com/v4.0/me/friends?access_token=${access_token}`;
  const result = await fetch(url);
  let jsonResult = await result.json();
  return jsonResult.summary.total_count;
}

async function getFriends(access_token, nextapi) {
  if (!nextapi || !nextapi.length) return [];
  let url = `https://graph.facebook.com/v4.0/me/friends?access_token=${access_token}&fields=id,name&limit=200`;
  if (nextapi != "url") url = nextapi;
  const result = await fetch(url);
  let jsonResult = await result.json();
  return [
    ...jsonResult.data,
    ...(await getFriends(access_token, jsonResult.paging.next))
  ];
}
async function getImagesByUid(access_token, uid, nextapi) {
  if (!nextapi || !nextapi.length) return [];
  let url = `https://graph.facebook.com/v4.0/${uid}/photos?access_token=${access_token}&fields=images&limit=20`;
  if (nextapi != "url") url = nextapi;
  const result = await fetch(url);
  let jsonResult = await result.json();
  const image_list = jsonResult.data.map(item => item.images[0].source);
  return [
    ...image_list,
    ...(await getImagesByUid(
      access_token,
      uid,
      jsonResult && jsonResult.paging && jsonResult.paging.next
        ? jsonResult.paging.next
        : ""
    ))
  ];
}
async function getImagesByUidLimit(access_token, uid, limit) {
  let url = `https://graph.facebook.com/fql?q=SELECT+src_big+FROM+photo+WHERE+owner+=+${uid}++ORDER+BY+created+DESC+LIMIT+${limit}&access_token=${access_token}`;
  // let url = `https://graph.facebook.com/v4.0/${uid}/photos?access_token=${access_token}&fields=images&limit=${limit}`;
  let result;
  try {
    result = await fetch(url);
    const jsonResult = await result.json();
    const image_list = jsonResult.data.map(item => item.src_big);
    return image_list;
  } catch (err) {
    url = `https://graph.facebook.com/v4.0/${uid}/photos?access_token=${access_token}&fields=images&limit=${limit}`;
    result = await fetch(url);
    const jsonResult = await result.json();
    const image_list = jsonResult.data.map(item => item.images[0].source);
    return image_list;
  }
}

async function getImages(access_token, listuid, index) {
  if (index >= listuid.length) return [];
  const uid = listuid[index];
  document.getElementById("process_status").innerText = `Đang xử lý ${index +
    1}/${listuid.length}`;
  const temp = {
    id: listuid[index].id,
    name: listuid[index].name,
    images: await getImagesByUidLimit(access_token, listuid[index].id, 20)
  };
  return [temp, ...(await getImages(access_token, listuid, index + 1))];
}

function download(filename, text, typeFile) {
  const data = new Blob([text], { type: typeFile });
  var textFile = "text";
  window.URL.revokeObjectURL(textFile);
  textFile = window.URL.createObjectURL(data);
  var element = document.createElement("a");
  element.setAttribute("href", textFile);
  element.setAttribute("download", filename);
  element.style.display = "none";
  document.body.appendChild(element);
  element.click();
  document.body.removeChild(element);
}

